window.bookSummaryJSON = "<p><b>Queen of paranormal romantic comedy Molly Harper delivers love and laughter in this magnificent series finale - available in audio first!</b>&nbsp;</p> <p>Eva Boudreaux keeps the truth about her life before arriving in Mystic Bayou a carefully guarded secret, flying under the radar as a talented boat mechanic. In the swampy little town filled with powerful supernatural beings, Eva never expected to strike up a charged flirtation with one of the Bayou’s human residents.&nbsp;</p> <p>Alex Lancaster is far too polished for Eva’s taste - not to mention the danger that comes with his high-ranking position in the League, which could expose her secrets. Trouble is, she can’t resist his disarming sense of humor or the chemistry that crackles to life whenever he’s near. Will Alex be able to handle a woman like her? Or will her difficult past keep them apart?&nbsp;</p> <p>Either way, they’ll need to join forces to solve one final mystery in Mystic Bayou. The fate of the town - and their hearts - depends upon it.</p>"; 
